import React, { useState } from 'react';
import { Outlet, Link } from "react-router-dom";
import { useAuth } from './AuthContext';
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import Toolbar from '@mui/material/Toolbar';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import MenuIcon from '@mui/icons-material/Menu';
import MenuItem from '@mui/material/MenuItem';
import Button from '@mui/material/Button';
import Container from '@mui/material/Container';

function HomePage() {
    const { isLoggedIn, logout } = useAuth();
    const [anchorElNav, setAnchorElNav] = useState(null);

    const handleOpenNavMenu = (event) => {
        setAnchorElNav(event.currentTarget);
    };

    const handleCloseNavMenu = () => {
        setAnchorElNav(null);
    };

    return (
        <Box sx={{ flexGrow: 1 }}>
            <AppBar position="static">
                <Container maxWidth="xl">
                    <Toolbar disableGutters>
                        <Typography
                            variant="h6"
                            noWrap
                            component="div"
                            sx={{ flexGrow: 1, display: { xs: 'none', sm: 'block' } }}
                        >
                            Your App Name
                        </Typography>
                        <Box sx={{ display: { xs: 'flex', sm: 'none' } }}>
                            <IconButton
                                size="large"
                                aria-label="account of current user"
                                aria-controls="menu-appbar"
                                aria-haspopup="true"
                                onClick={handleOpenNavMenu}
                                color="inherit"
                            >
                                <MenuIcon />
                            </IconButton>
                            <Menu
                                id="menu-appbar"
                                anchorEl={anchorElNav}
                                anchorOrigin={{
                                    vertical: 'bottom',
                                    horizontal: 'left',
                                }}
                                keepMounted
                                transformOrigin={{
                                    vertical: 'top',
                                    horizontal: 'left',
                                }}
                                open={Boolean(anchorElNav)}
                                onClose={handleCloseNavMenu}
                                sx={{
                                    display: { xs: 'block', sm: 'none' },
                                }}
                            >
                                {/* Menu items for mobile */}
                                <MenuItem onClick={handleCloseNavMenu}>
                                    <Typography textAlign="center"><Link to="/">Home</Link></Typography>
                                </MenuItem>
                                {!isLoggedIn && (
                                    <>
                                        <MenuItem onClick={handleCloseNavMenu}>
                                            <Typography textAlign="center"><Link to="/login">Login</Link></Typography>
                                        </MenuItem>
                                        <MenuItem onClick={handleCloseNavMenu}>
                                            <Typography textAlign="center"><Link to="/register">Register</Link></Typography>
                                        </MenuItem>
                                    </>
                                )}
                            </Menu>
                        </Box>
                        <Box sx={{ flexGrow: 1, display: { xs: 'none', sm: 'flex' } }}>
                            {/* Nav items for larger screens */}
                            <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                                <Link to="/">Home</Link>
                            </Button>
                            {!isLoggedIn && (
                                <>
                                    <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                                        <Link to="/login">Login</Link>
                                    </Button>
                                    <Button sx={{ my: 2, color: 'white', display: 'block' }}>
                                        <Link to="/register">Register</Link>
                                    </Button>
                                </>
                            )}
                        </Box>
                        {isLoggedIn && (
                            <Button color="inherit" onClick={logout}>Logout</Button>
                        )}
                    </Toolbar>
                </Container>
            </AppBar>
            <Outlet />
        </Box>
    );
}

export default HomePage;
